// AboutMe.jsx
import React from 'react';
import { Parallax } from 'react-parallax';

const AboutMe = () => {
  return (
    <Parallax bgImage="path_to_image" strength={500}>
      <div style={{ height: 500 }}>
        <h2>About Me</h2>
        <p>This is the about me section.</p>
      </div>
    </Parallax>
  );
};

export default AboutMe;
